import loginHeader from "../resources/loginHeader.png";
import styles from "./LoginHeader.module.scss";

function Loginpage() {
  return (
    <div>
      <header className={styles.header}>
        <img
          src={loginHeader}
          className={styles.img}
          alt='Login Header'
          title='Login Header'
        />
      </header>
    </div>
  );
}
export default Loginpage;
